oxy_webhelp_navlinks = {"desktop_private_client_workspace-d2013e224":{"topics":[{"title":"Desktop workspace UI page for Private Client","shortdesc":"<p class=\"shortdesc\">Desktop workspace UI page was specially designed for Private client Role. It is         opened as bank's private clients login to their internet banking application. Private         clients manage their banking operations within workspace UI page and reach other product or         task UI pages through it.<\/p>","href":"topics\/privat_clients_ui_workspace.html","attributes":{"data-id":"privat_clients_ui_workspace"},"menu":{"hasChildren":false},"tocID":"privat_clients_ui_workspace-d2013e235","topics":[]},{"title":"Introduction page (Overview)","href":"topics\/introduction_page_overview.html","attributes":{"data-id":"introduction_page_overview"},"menu":{"hasChildren":false},"tocID":"introduction_page_overview-d2013e246","topics":[]},{"title":"Desktop bank's product UI pages for Private client","shortdesc":"<p class=\"shortdesc\">Banks provide their products to clients. Domestic and Foreign accounts, Cards, Orders         etc. are the bank products. To operate with bank products special UI pages are created.         Clients handle product specific banking operations within product UI pages.<\/p>","href":"topics\/privat_clients_bank_product_ui_pages.html","attributes":{"data-id":"privat_clients_bank_product_ui_pages"},"menu":{"hasChildren":false},"tocID":"privat_clients_bank_product_ui_pages-d2013e254","next":"privat_clients_bank_product_ui_pages-d2013e254"},{"title":"Desktop tasks UI pages for Private Clients","shortdesc":"<p class=\"shortdesc\">Clients handle internet banking operations within specially designed UI pages. Those         banking operations we considered for Tasks. Changing card pin code, making new payment,         setting payment orders etc. are banking Tasks. Usually to gain a result you need to pass         some steps. To ease handling all task steps, special UI page is created.<\/p>","href":"topics\/privar_clients_tasks_ui_pages.html","attributes":{"data-id":"privar_clients_tasks_ui_pages"},"menu":{"hasChildren":false},"tocID":"privar_clients_tasks_ui_pages-d2013e309","next":"privar_clients_tasks_ui_pages-d2013e309"},{"title":"Desktop steps UI controls for Private Clients","shortdesc":"<p class=\"shortdesc\">UI control is a visual representative of  a task's step. Drop down menu, buttons,         fields etc. are UI controls. UI controls are usually connected to software application         source code steps (functions) and data.<\/p>","href":"topics\/privar_clients_steps_ui_controles.html","attributes":{"data-id":"privar_clients_steps_ui_controles"},"menu":{"hasChildren":false},"tocID":"privar_clients_steps_ui_controles-d2013e331","next":"privar_clients_steps_ui_controles-d2013e331"}]}};